description:
An improvised vocalisation to 달빛의 노래 (Song of the Moon) from the 해를 품은 달/The Moon that Embraces the Sun OST. 

Music by: 김준석, 정세린;
Vocal by: me

A dance-track I composed back in 1999. For this song I used the MU90R from Yamaha and a few drum-samples. Pretty old stuff produced and recorded with outdated hard- and software. Hope you like it anyway. A big kiss to Ina for the vocals! Please leave a comment.

//

Ein Dance-Track, den ich bereits 1999 komponiert habe. Für diesen Song habe ich den MU90R von Yamaha und ein paar Drum-Samples verwendet. Ziemlich altes Stück, produziert und aufgenommen mit veralteter Hard- und Software. Ich hoffe Ihr mögt es trotzdem. Dickes Bussi an Ina für die Vocals! Bitte hinterlasse einen Kommentar.

